import React from "react";
import { Route, Routes } from "react-router-dom";
import AdminLogin from "./Component/AdminLogin"; // スペルを確認して修正
import AdminDashboard from "./Component/AdminDashboard"; // スペルを確認して修正

function App() {
  return (
    <Routes>
      <Route path="/login" element={<AdminLogin />} />
      <Route path="/" element={<AdminDashboard />} />
    </Routes>
  );
}

export default App;
